import '../../Css/Main.css';
import mainpage from '../../img/mainpage.jpg';
import React from 'react';

function Main() {
  return (
    <div>
      <div id="main">

          <div id="main_1">
              <div class="main1_content1">
                  <div>간편하게 구호물품을</div>
                  <div>후원하고 거래해보세요</div>
              </div>
              <div class="main1_content2">
                  <text>95창고</text>
              </div>
          </div>
          <div id="main_2">
              <img class="mainpage_bg" src={mainpage}></img>
          </div>
      </div>
    </div>
  );
}

export default Main;
